import { Card, Space } from "antd";

function DeviceCard(deviceDetails) {
  return (
    <div>
      <p>{deviceDetails.os}</p>
      <Card
        headStyle={{
          color: "white",
          background: "#3E3D40",
        }}
        title={
          <div>
            <b>Hostname: </b>
            {deviceDetails.os}
          </div>
        }
        style={{
          width: "100%",
          overflow: "hidden",
          color: "white",
          margin: "0 auto",
        }}
        bodyStyle={{ background: "#1F1E26" }}
      >
        <Space size={21}>
          <p>Device Status:</p>{" "}
          <p style={{ color: "#45d5c9" }}>
            <b>ACTIVE</b>
          </p>
        </Space>
        <Space size={25}>
          <p>Device Type:</p>{" "}
          <p>
            <b>ACTIVE</b>
          </p>
        </Space>
        <Space size={28}>
          <p>OS Version:</p>{" "}
          <p>
            <b>ACTIVE</b>
          </p>
        </Space>
        <Space size={23}>
          <p>Mac Address:</p>{" "}
          <p>
            <b>ACTIVE</b>
          </p>
        </Space>
      </Card>
    </div>
  );
}

export default DeviceCard;
